// extracts all entries of "INDIAN-RED" and "FOREST-GREEN" 
// from freeform-table's table-cells and return a string of space-separated "R" and "G"
extract-interesting-colors-from-ft-cells(ft : class freeform-table ) = (text)
table-cells: structure; 
txt : text; 
match:structure; 
substring: text;
mark: text;
result : text;
i,ei:integer;
begin
  txt = "[the table-cells of ft]";
  result = ""; 
  i = 1;
  repeat
    match=find-next-pattern("(INDIAN-RED)|(FOREST-GREEN)",txt,i);
    ei = the end-index of match; 
    exit if ei = 0;
    substring = get-from-text(txt,the start-index of match,ei);
    if substring = "INDIAN-RED" then
      mark="R"
    else
      mark="G";
    result = "[result] [mark]";
    i = ei;
  end;
return result;
end

